import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="logo">QuickReserve</div>
      <nav className="nav-links">
        <a href="#">Inicio</a>
        <a href="#">Profesores</a>
        <a href="#">Mis Citas</a>
        <a href="#">Calendario</a>
        <a href="#">Soporte</a>
      </nav>
      <div className="nav-buttons">
        <button className="login">Ingresar</button>
        <button className="signup">Registrarse</button>
      </div>
    </header>
  );
}

export default Header;
